const Pokemon = ({ pokemon }) => {
    const abilities = pokemon.abilities.map((ability, i) => {
        const name = ability.ability.name
        return <li className="capitalize" key={i}>{ability.ability.name}</li>
    })

    return (
        <div>
            Abilities
            {abilities}
        </div>
    )
}

export default Pokemon
